function [a,c]=FindAxes(x,y)
a=sqrt(-(x/3)+(2^(1/3)*x^2)/(3*(-2*x^3+27*y^2+3*sqrt(-12*x^3*y^2+81*y^4))^(1/3))+(-2*x^3+27*y^2+3*sqrt(-12*x^3*y^2+81*y^4))^(1/3)/(3*2^(1/3)));
c=((9*y^2+sqrt(-12*x^3*y^2+81*y^4))*(2^(1/3)*x+(-2*x^3+27*y^2+3*sqrt(-12*x^3*y^2+81*y^4))^(1/3)))/(3*y*(-4*x^3+54*y^2+6*sqrt(-12*x^3*y^2+81*y^4))^(2/3));